import React from 'react';
import { Box } from "@mui/material";
import rentalsImage from '../../src/assets/Rentals.png';

const Nav = () => {
    return (
        <Box bgcolor="lightblue">
        <div>
         <img src={rentalsImage} alt="img" />
         home
        </div>

        </Box>
    )
}
export default Nav
